import { Box } from "@mui/system";
import { Toolbar } from "@mui/material";

import { ServiceData } from "./Servicesnew";
import { ServicesTableActions } from "./Servicesnew";
import axios from 'axios';
import * as React from 'react';

export const Services12=()=>{

  const [data,setData]=React.useState<ServiceData[]>([]);

  const getProductData = async () => {
      try {
        const data = await axios.get<ServiceData[]>(
          // `https://my-json-server.typicode.com/sakthi-vunet/dummyservicesnew/list`
          'http://127.0.0.1:8000/api/services/'
        );

        setData(data.data);
      } catch (e) {
        console.log(e);
      }
    };
  React.useEffect(() => {
      getProductData();
  }, []);

  return (

    <Box
    component="main"
    sx={{ flexGrow: 1, p: 3,display:'flex'}}>
     {/* marginLeft: {  sm: `200px`, md: `200px`}}}> */}
    <Toolbar />

    <ServicesTableActions data={data}/>

    </Box>

  );
  }
